import { Button, Form, FormGroup, Label, Input, Navbar, NavbarBrand } from 'reactstrap';
import React from 'react';

class NavBar extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
        <Navbar>
            <NavbarBrand href="/">reactstrap</NavbarBrand>
        </Navbar>
        );
    }
}

export default NavBar
